import {useState} from 'react';


export const Text = () =>{
    const [text,setText] = useState("");
    return(
        <div>
            <input onChange={handleInputChange}/>
            <h1>{text}</h1>
        </div>
    );
}

const handleInputChange = (event) =>{
    setText(event.target.value);
}
